CREATE TABLE #AlunosProvas
(
Test_Id INT,
Alu_Id INT,
Tur_Id INT
)

--select * from #AlunosProvas


select 
	GETDATE(),GETDATE(),1,Test_Id,Tur_Id,Alu_Id,'6CF424DC-8EC3-E011-9B36-00155D033206',4,3
from #AlunosProvas
where 
	Test_Id=601 and 
	alu_Id NOT IN (select AluId from StudentTestSent where TestId=601)

select 
	GETDATE(),GETDATE(),1,Test_Id,Tur_Id,Alu_Id,'6CF424DC-8EC3-E011-9B36-00155D033206',4,3
from #AlunosProvas
where 
	Test_Id=602 and 
	alu_Id NOT IN (select AluId from StudentTestSent where TestId=602)
	
	
UPDATE StudentTestSent SET Situation=1 where TestId IN (601,602)	
